/*Table structure for table `salary_point` */

DROP TABLE IF EXISTS `salary_point`;

CREATE TABLE `salary_point` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `station_level` decimal(10,2) NOT NULL COMMENT '岗级',
  `salary_level` decimal(10,2) NOT NULL COMMENT '薪级',
  `score` decimal(10,2) NOT NULL COMMENT '薪点值',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
