/*Table structure for table `user_info` */

DROP TABLE IF EXISTS `user_info`;

CREATE TABLE `user_info` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `base_id` int(10) unsigned NOT NULL COMMENT '用户Base表ID',
  `job_name` varchar(50) DEFAULT NULL COMMENT '岗位名称',
  `job_type` varchar(50) DEFAULT NULL COMMENT '岗位类别',
  `job_queue` varchar(50) DEFAULT NULL COMMENT '岗位序列',
  `job_level` varchar(50) DEFAULT NULL COMMENT '职务级别',
  `gender` varchar(5) DEFAULT NULL COMMENT '性别',
  `id_card` varchar(50) DEFAULT NULL COMMENT '身份证号',
  `emp_type` varchar(50) DEFAULT NULL COMMENT '用工形式',
  `emp_submit_type` varchar(50) DEFAULT NULL COMMENT '劳动关系确定方式',
  `emp_parent` varchar(50) DEFAULT NULL COMMENT '劳动关系主体',
  `contract_type` varchar(50) DEFAULT NULL COMMENT '劳动合同期',
  `contract_begin` date DEFAULT NULL COMMENT '合同起始时间',
  `contract_end` date DEFAULT NULL COMMENT '合同到期时间',
  `single_child_birthday` date DEFAULT NULL COMMENT '独生子女生日',
  `work_age` int(10) DEFAULT NULL COMMENT '工龄',
  `current_education` varchar(50) DEFAULT NULL COMMENT '当前学历',
  `current_degree` varchar(50) DEFAULT NULL COMMENT '当前学位',
  `tech_job_level` varchar(50) DEFAULT NULL COMMENT '专业技术职务等级',
  `tech_level` varchar(50) DEFAULT NULL COMMENT '技能等级',
  `certificates` varchar(50) DEFAULT NULL COMMENT '持有证件名称',
  `certificate_count` int(10) DEFAULT '0' COMMENT '持有证件数量',
  `tech_leader` varchar(50) DEFAULT NULL COMMENT '技术带头人',
  `nation` varchar(50) DEFAULT NULL COMMENT '民族',
  `birthday` date DEFAULT NULL COMMENT '出生日期',
  `age` int(10) DEFAULT NULL COMMENT '年龄',
  `work_year` int(10) DEFAULT NULL COMMENT '参加工作时间年',
  `work_month` int(10) DEFAULT NULL COMMENT '参加工作时间月',
  `prof_title` varchar(50) DEFAULT NULL COMMENT '职称',
  `work_education` varchar(50) DEFAULT NULL COMMENT '参加工作学历',
  `education_school` varchar(50) DEFAULT NULL COMMENT '毕业院校',
  `education_major` varchar(50) DEFAULT NULL COMMENT '毕业专业',
  `education_time` datetime DEFAULT NULL COMMENT '毕业时间',
  `education_school_1` varchar(50) DEFAULT NULL COMMENT '毕业院校',
  `education_major_1` varchar(50) DEFAULT NULL COMMENT '毕业专业',
  `education_time_1` datetime DEFAULT NULL COMMENT '毕业时间',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `user_info_id_ibfk1` (`base_id`),
  CONSTRAINT `user_info_id_ibfk1` FOREIGN KEY (`base_id`) REFERENCES `user_base_info` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=164 DEFAULT CHARSET=utf8 COMMENT='员工详细信息';

