/*Table structure for table `user_salary_rate` */

DROP TABLE IF EXISTS `user_salary_rate`;

CREATE TABLE `user_salary_rate` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `base_id` int(10) unsigned NOT NULL COMMENT 'BaseInfo表ID',
  `single_rate` decimal(4,2) DEFAULT '-1.00' COMMENT '单项奖系数',
  `station_level` decimal(4,2) DEFAULT '-1.00' COMMENT '定岗岗级',
  `true_station_level` decimal(4,2) DEFAULT '-1.00' COMMENT '执行岗级',
  `salary_level` decimal(4,2) DEFAULT '-1.00' COMMENT '薪级',
  `salary_point` decimal(10,2) DEFAULT '-1.00' COMMENT '薪点',
  `station_point` decimal(4,2) DEFAULT '-1.00' COMMENT '岗位点值',
  `performance_station_level` decimal(4,2) DEFAULT '-1.00' COMMENT '月度绩效执行岗级',
  `performance_salary_level` decimal(4,2) DEFAULT '-1.00' COMMENT '月度绩效执行薪级',
  `performance_salary_point` decimal(10,2) DEFAULT '-1.00' COMMENT '月度绩效执行薪点',
  `performance_point` decimal(10,2) DEFAULT '-1.00' COMMENT '月度绩效点值',
  `performance_rate` decimal(10,2) DEFAULT '-1.00' COMMENT '绩效工资倾斜点值',
  `performance_examine_rate` decimal(4,2) DEFAULT '-1.00' COMMENT '绩效考核系数',
  `performance_promise_rate` decimal(4,2) DEFAULT '-1.00' COMMENT '绩效兑现系数',
  `station_salary_promise_rate` decimal(4,2) DEFAULT '-1.00' COMMENT '岗位工资兑现比率',
  `performance_station_rate` decimal(4,3) DEFAULT '-1.000' COMMENT '绩效岗级系数',
  `salary_average_monthly` decimal(10,2) DEFAULT '-1.00' COMMENT '月平均',
  `base_medical_insurance` decimal(10,2) DEFAULT '-1.00' COMMENT '医保基数',
  `society_average_province` decimal(10,2) DEFAULT '-1.00' COMMENT '省社平',
  `society_average_city` decimal(10,2) DEFAULT '-1.00' COMMENT '市社平',
  `unemployment_company` decimal(10,2) DEFAULT '-1.00' COMMENT '失业保险单位',
  `unemployment_person` decimal(10,2) DEFAULT '-1.00' COMMENT '失业保险个人',
  `old_company` decimal(10,2) DEFAULT '-1.00' COMMENT '养老保险单位',
  `old_person` decimal(10,2) DEFAULT '-1.00' COMMENT '养老保险个人',
  `company_reward_company` decimal(10,2) DEFAULT '-1.00' COMMENT '企业年金单位',
  `company_reward_person` decimal(10,2) DEFAULT '-1.00' COMMENT '企业年金个人',
  `medical_insurance_company` decimal(10,2) DEFAULT '-1.00' COMMENT '医保费单位',
  `medical_insurance_person` decimal(10,2) DEFAULT '-1.00' COMMENT '医保费个人',
  `housing_fund_company` decimal(10,2) DEFAULT '-1.00' COMMENT '公积金单位',
  `housing_fund_person` decimal(10,2) DEFAULT '-1.00' COMMENT '公积金个人',
  `other1` decimal(10,2) DEFAULT '0.00' COMMENT '其他增加点值',
  `other2` decimal(10,2) DEFAULT '0.00',
  `fact_tax_year` decimal(10,2) DEFAULT '0.00' COMMENT '实补扣年金税金',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  PRIMARY KEY (`id`),
  KEY `base_id` (`base_id`),
  CONSTRAINT `user_salary_id_ibfk` FOREIGN KEY (`base_id`) REFERENCES `user_base_info` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
