/* Procedure structure for procedure `pro_createcurrentreport` */

/*!50003 DROP PROCEDURE IF EXISTS  `pro_createcurrentreport` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`root`@`localhost` PROCEDURE `pro_createcurrentreport`()
BEGIN
      
     -- 遍历数据结束标志
    DECLARE done INT DEFAULT 0;
    -- 异常处理
    DECLARE t_error INTEGER DEFAULT 0;  
    -- 参数生成
    DECLARE c_id INT(10) UNSIGNED; -- BaseInfo表ID
    DECLARE c_work_age INT(10); -- BaseInfo表ID
    DECLARE c_nation VARCHAR(50);  -- BaseInfo表ID
    DECLARE c_single_rate DECIMAL(4,2); -- 单项奖系数
    DECLARE c_station_level DECIMAL(4,2); -- 定岗岗级
    DECLARE c_true_station_level DECIMAL(4,2); -- 执行岗级
    DECLARE c_salary_level DECIMAL(4,2); -- 薪级
    DECLARE c_salary_point DECIMAL(10,2); -- 薪点
    DECLARE c_station_point DECIMAL(4,2); -- 岗位点值
    DECLARE c_performance_station_level DECIMAL(4,2); -- 月度绩效执行岗级
    DECLARE c_performance_salary_level DECIMAL(4,2); -- 月度绩效执行薪级
    DECLARE c_performance_salary_point DECIMAL(10,2); -- 月度绩效执行薪点
    DECLARE c_performance_point DECIMAL(10,2); -- 月度绩效点值
    DECLARE c_performance_rate DECIMAL(10,2); -- 绩效工资倾斜点值
    DECLARE c_performance_examine_rate DECIMAL(4,2); -- 绩效考核系数
    DECLARE c_performance_promise_rate DECIMAL(4,2); -- 绩效兑现系数
    DECLARE c_station_salary_promise_rate DECIMAL(4,2); -- 岗位工资兑现比率
    DECLARE c_performance_station_rate DECIMAL(4,3); -- 绩效岗级系数
    DECLARE c_salary_average_monthly DECIMAL(10,2); -- 月平均
    DECLARE c_base_medical_insurance DECIMAL(10,2); -- 医保基数
    DECLARE c_society_average_province DECIMAL(10,2); -- 省社平
    DECLARE c_society_average_city DECIMAL(10,2); -- 市社平
    DECLARE c_unemployment_company DECIMAL(10,2); -- 失业保险单位
    DECLARE c_unemployment_person DECIMAL(10,2); -- 失业保险个人
    DECLARE c_old_company DECIMAL(10,2); -- 养老保险单位
    DECLARE c_old_person DECIMAL(10,2); -- 养老保险个人
    DECLARE c_company_reward_company DECIMAL(10,2); -- 企业年金单位
    DECLARE c_company_reward_person DECIMAL(10,2); -- 企业年金个人
    DECLARE c_medical_insurance_company DECIMAL(10,2); -- 医保费单位
    DECLARE c_medical_insurance_person DECIMAL(10,2); -- 医保费个人
    DECLARE c_housing_fund_company DECIMAL(10,2); -- 公积金单位
    DECLARE c_housing_fund_person DECIMAL(10,2); -- 公积金个人
    DECLARE c_other1 DECIMAL(10,2); -- 其他增加点值
    DECLARE c_other2 DECIMAL(10,2); -- 备用字段
    DECLARE c_fact_tax_year DECIMAL(10,2); -- 年税金
    -- 获取工资系数游标
    DECLARE cur CURSOR FOR SELECT 
    `id`, 
    `work_age`,
    `nation`,
    `single_rate`, 
    `station_level`, 
    `true_station_level`, 
    `salary_level`, 
    `salary_point`, 
    `station_point`, 
    `performance_station_level`, 
    `performance_salary_level`, 
    `performance_salary_point`, 
    `performance_point`, 
    `performance_rate`, 
    `performance_examine_rate`, 
    `performance_promise_rate`, 
    `station_salary_promise_rate`, 
    `performance_station_rate`, 
    `salary_average_monthly`, 
    `base_medical_insurance`, 
    `society_average_province`, 
    `society_average_city`, 
    `unemployment_company`, 
    `unemployment_person`, 
    `old_company`, 
    `old_person`, 
    `company_reward_company`, 
    `company_reward_person`, 
    `medical_insurance_company`, 
    `medical_insurance_person`, 
    `housing_fund_company`, 
    `housing_fund_person`, 
    `other1`, 
    `other2`, 
    `fact_tax_year`  
    FROM 
    `salary`.`v_user_info`;
    
    DECLARE CONTINUE HANDLER FOR SQLEXCEPTION SET t_error=1;
    DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;
    
    START TRANSACTION;
    
    -- 打开游标
    OPEN cur;
    -- 开始循环
    read_loop:LOOP
    -- 提取游标里的数据
    FETCH cur INTO c_id,
    c_work_age,
    c_nation,
    c_single_rate,
    c_station_level,
    c_true_station_level,
    c_salary_level,
    c_salary_point,
    c_station_point,
    c_performance_station_level,
    c_performance_salary_level,
    c_performance_salary_point,
    c_performance_point,
    c_performance_rate,
    c_performance_examine_rate,
    c_performance_promise_rate,
    c_station_salary_promise_rate,
    c_performance_station_rate,
    c_salary_average_monthly,
    c_base_medical_insurance,
    c_society_average_province,
    c_society_average_city,
    c_unemployment_company,
    c_unemployment_person,
    c_old_company,
    c_old_person,
    c_company_reward_company,
    c_company_reward_person,
    c_medical_insurance_company,
    c_medical_insurance_person,
    c_housing_fund_company,
    c_housing_fund_person,
    c_other1,
    c_other2,
    c_fact_tax_year;
    -- 声明结束的时候
    IF done THEN
      LEAVE read_loop;
    END IF;
    -- 岗位工资
    SET @tmp_station := round(c_salary_point*c_station_point*c_station_salary_promise_rate,2);
    
    -- 资历工资
    SET @tmp_salary_age := c_work_age*2*6;
    
    -- 回民补贴
    IF c_nation <> '回族' THEN
        SET @tmp_nation := 0;
    ELSE
        SET @tmp_nation := 8;
    END IF;
    -- 应发小计
    SET @tmp_should_sum := @tmp_station+@tmp_salary_age+@tmp_salary_age+@tmp_nation;
    -- 扣除部分
    SET @tmp_deduction := c_unemployment_person+c_old_person+c_company_reward_person+c_housing_fund_person+c_fact_tax_year;
    -- 应税金额
    SET @tmp_receivable_tax := @tmp_should_sum-3500+c_fact_tax_year-@tmp_deduction;
    
    -- 税金计算
    CASE 
        WHEN (@tmp_receivable_tax <= 0) THEN
            SET @tmp_tax := 0;
        WHEN (@tmp_receivable_tax <= 1500) THEN
            SET @tmp_tax := ROUND(@tmp_receivable_tax*0.03,2);
        WHEN (@tmp_receivable_tax <= 4500) THEN
            SET @tmp_tax := ROUND(@tmp_receivable_tax*0.1-105,2);
        WHEN (@tmp_receivable_tax <= 9000) THEN
            SET @tmp_tax := ROUND(@tmp_receivable_tax*0.2-555,2);
        WHEN (@tmp_receivable_tax <= 35000) THEN
            SET @tmp_tax := ROUND(@tmp_receivable_tax*0.25-1005,2);
        WHEN (@tmp_receivable_tax <= 55000) THEN
            SET @tmp_tax := ROUND(@tmp_receivable_tax*0.3-2755,2);
        WHEN (@tmp_receivable_tax <= 80000) THEN
            SET @tmp_tax := ROUND(@tmp_receivable_tax*0.35-5505,2);
        ELSE
            SET @tmp_tax := FORMAT(@tmp_receivable_tax*0.35-5505,2);
    END CASE;
    -- 应扣小计
    SET @tmp_sum_deduction := @tmp_deduction+@tmp_tax;
    -- 实发小计
    SET @tmp_sum_fact := @tmp_should_sum-@tmp_sum_deduction;
    
    INSERT INTO `salary`.`salary_calculation` 
    (
    `base_id`, 
    `salary_station`, 
    `salary_age`, 
    `salary_special_nation`, 
    `sum_salary_should`, 
    `unemployment`, 
    `s_old`, 
    `company_reward`, 
